    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Cedar Keys NWR and Lower Suwannee NWR for the
    next 15 years. This plan outlines the refuges' vision and purpose and describes
    how Cedar Keys NWR and Lower Suwannee NWR will contribute to the overall mission
    of the Refuge System. The plan provides an introduction to the Refuges, an overview
    of the CCP process, planning issues and opportunities, and information about the
    management direction and plan implementation. Key planning issues include: wildlife,
    habitat, resource protection, public use, and landscape management.",nt"owner_org":
